import React from 'react';
import "../../css/login_signupCss/login_signupCSS.css"
import validate, {field} from '../../components/login_signup/validator';
import InputErrors from "../../components/login_signup/inputErrors";
import api from "../../server_api/api";

class MySpace extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            email: field({name: 'email', isRequired: true, pattern: /^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/}),
            password: field({name: 'password', isRequired:true, minLength: 6}),
        };

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange({target:{name,value}}){
        const errors = validate(name, value, this.state[name].validations);

        this.setState({
            [name]: {
                ...this.state[name],
                value,
                errors
            }
        });
    }

    handleSubmit = (event)=> {
        event.preventDefault();
        let isOK = true;
        for (let prop in this.state) {
            const fa = this.state[prop];
            console.log(fa)
            const errors = validate(prop, fa.value, fa.validations);
            if (errors.length) {
                isOK = false;
                this.setState({
                    [prop]: {
                        ...this.state[prop],
                        errors
                    }
                });
            }
        }
        if(isOK){
            const result = this.state;
            for(let prop in this.state){
                result[prop] = this.state[prop].value;
            }
            api.loginUser(result)
                .then(res => {console.log(res)})

        }
    };



    render() {
        return (
            <div className={"row"}>
                <div className="col-md-5 mx-auto">
                    <div className="myform form ">
                        <div className="logo mb-3">
                            <div className="col-md-12 text-center">
                                <h1 className={"head_line"}>Upload new apartment</h1>
                            </div>
                        </div>
                        <form>
                            <div className="form-row">
                                <div className="col-md-4 mb-3">
                                    <label htmlFor="validationDefault01">First name</label>
                                    <input type="text" className="form-control" id="validationDefault01"
                                           placeholder="First name" value="Mark" required/>
                                </div>
                                <div className="col-md-4 mb-3">
                                    <label htmlFor="validationDefault02">Last name</label>
                                    <input type="text" className="form-control" id="validationDefault02"
                                           placeholder="Last name" value="Otto" required/>
                                </div>
                                <div className="col-md-4 mb-3">
                                    <label htmlFor="validationDefaultUsername">Username</label>
                                    <div className="input-group">
                                        <div className="input-group-prepend">
                                            <span className="input-group-text" id="inputGroupPrepend2">@</span>
                                        </div>
                                        <input type="text" className="form-control" id="validationDefaultUsername"
                                               placeholder="Username" aria-describedby="inputGroupPrepend2" required/>
                                    </div>
                                </div>
                            </div>
                            <div className="form-row">
                                <div className="col-md-6 mb-3">
                                    <label htmlFor="validationDefault03">City</label>
                                    <input type="text" className="form-control" id="validationDefault03"
                                           placeholder="City" required/>
                                </div>
                                <div className="col-md-3 mb-3">
                                    <label htmlFor="validationDefault04">State</label>
                                    <input type="text" className="form-control" id="validationDefault04"
                                           placeholder="State" required/>
                                </div>
                                <div className="col-md-3 mb-3">
                                    <label htmlFor="validationDefault05">Zip</label>
                                    <input type="text" className="form-control" id="validationDefault05"
                                           placeholder="Zip" required/>
                                </div>
                            </div>
                            <div className="form-group">
                                <div className="form-check">
                                    <input className="form-check-input" type="checkbox" value="" id="invalidCheck2"
                                           required/>
                                        <label className="form-check-label" htmlFor="invalidCheck2">
                                            Agree to terms and conditions
                                        </label>
                                </div>
                            </div>
                            <button className="btn btn-primary" type="submit">Submit form</button>
                        </form>
                    </div>
                </div>
            </div>

        )
    }
}

export default MySpace;
